import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import HelloWorld from './components/HelloWorld';
import Registration from './components/Registration';
import Login from './components/Login';

function App() {
  return (
    <div className="App">
      <HelloWorld />
      <Registration />
      <Login />
    </div>
  );
}

export default App;
